import React from "react";
import hello from "./hello.png";
import LoginForm from "./LoginForm/LoginForm";

const textStyle = {
  position: "relative",
  fontSize: "2vh",
  color: "#748281",
  top: "20vh",
  left: "5vw",
};

const helloStyle = {
  position: "relative",
  width: "20vw",
  top: "23vh",
  left: "4vw",
};

const LeftPanel = () => {
  return (
    <div>
      <div className="Login-text" style={textStyle}>
        LOGIN
      </div>
      <img className="Hello" src={hello} alt="" style={helloStyle} />
      <LoginForm />
      <div>
        <i class="question circle icon" style={{ top: "90vh" }}></i>
      </div>
    </div>
  );
};

export default LeftPanel;
